      content: "[color=#b8972d]███[/color][color=#1d7a1d]░███░░░░██░░░░[/color][color=#b8972d]                          ★ ★ ★[/color][color=#1d7a1d]\n░██░████░░░██░░░░           [head=3]Бланк документа[/head]\n░░█░██░██░░██░█░░                   [head=3]NanoTrasen[/head]\n░░░░██░░██░██░██░                        [bold]ЦК-КОМ[/bold]\n░░░░██░░░████░[/color][color=#b8972d]███[/color][color=#b8972d]                          ★ ★ ★[/color]\n=============================================\n            [bold]ПРИКАЗ СЕКТОРИАЛЬНОГО ШТАБА[/bold]\n=============================================\n  \n  Уважаемый [bold][color=#A60000]глава службы безопасности[/color][/bold] научно-исследовательского объекта [bolditalic][color=#644AD8]Колтер[/color][/bolditalic]! Уведомляем вас о введении специальных протоколов пропуска на объект через [italic]внешние центральные и северные[/italic] гермозатворы.\n\n  [italic]Все нижеперечисленные процедуры должны исполняться бесприкословно, а их отмена может быть инициирована только соответствующим приказом[/italic] [bolditalic][color=#1d7a1d]Центрального Командования[/color][/bolditalic] [italic]и/или сотрудников[/italic] [bolditalic][color=#1d7a1d]ДСО[/color][/bolditalic].\n\n         [color=#1d7a1d][head=3]Стандартные рабочие процедуры[/head][/color]\n                              [color=#1d7a1d][bold]Пропуска на объект[/bold][/color]\n\n[italic]Уполномоченное лицо в данном контексте - Глава Службы Безопасности, Капитан, Представители Секториального Штаба Центрального Командования, Сотрудники ДСО.[/italic]\n\n[bullet]Необходимо удостовериться, что за первым слоем гермозатворов действительно находится [bold]ожидающий пропуска[/bold].\n[bullet]Необходимо осмотреть внешний вид этого гуманоида. (по решению уполномоченных лиц данный пункт может быть упразднён)\n      [bullet][italic]В случае, если внешний вид гуманоида вызывает[/italic]\n         [italic]подозрения - необходимо запросить на КПП[/italic]\n         [italic]уполномоченное лицо для вынесения решения.[/italic]\n[bullet]Необходимо уведомить о гуманоиде в канал службы безопасности.\n[bullet]Если внешний вид гуманоида не вызывает подозрений - его можно пропустить за первый (внешний) слой гермозатворов [bold]Одним[/bold] нажатием на кнопку с замком.\n[bullet]Перед вторым нажатием на кнопку сотрудник службы безопасности вне зависимости от кода угрозы обязан: Обыскать гуманоида (если тот не обладает юридической неприкосновенностью), Нагреть буфер до температуры 280 по Кельвину и выше, Сверить личность гуманоида с уже существующими записями в консоли станционного учёта или в консоли криминалистических записей.\n       [bullet]Если личность не установлена - необходимо\n        следовать процедуре обращения с\n        незарегистрированными лицами.\n[bullet]После прохождения этих процедур гуманоид может быть допущен к переходу за второй (внутренний) уровень гермозатворов.\n\n[italic]В случае, если гуманоид получит значительные термические ожоги при прохождении этих процедур по вине сотрудника службы безопасности - последнему может быть назначен приговор по статьям о нанесении телесных повреждений.[/italic]\n[italic]В случае, если на станции резко упадёт температура по вине сотрудника службы безопасности - последнему может быть назначен приговор по статье о грубой халатности.[/italic]\n\n[bold]Слава NanoTrasen!\n[/bold]\n=============================================\n                                [italic]Место для печатей[/italic]"
