      content: "[color=#b8972d]███[/color][color=#1d7a1d]░███░░░░██░░░░[/color][color=#b8972d]                          ★ ★ ★[/color][color=#1d7a1d]\n░██░████░░░██░░░░           [head=3]Бланк документа[/head]\n░░█░██░██░░██░█░░                   [head=3]NanoTrasen[/head]\n░░░░██░░██░██░██░                        [bold]ЦК-КОМ[/bold]\n░░░░██░░░████░[/color][color=#b8972d]███[/color][color=#b8972d]                          ★ ★ ★[/color]\n=============================================\n        [bold]УВЕДОМЛЕНИЕ СЕКТОРИАЛЬНОГО ШТАБА[/bold]\n=============================================\n  \n  Уважаемый [bold][color=#1A2E7D]Капитан[/color][/bold] научно-исследовательского объекта [bolditalic][color=#644AD8]Колтер[/color][/bolditalic]! Для удобства организации и распределения органических ресурсов предоставляем вам краткие сведения о планете, на которой вы пребываете в настоящий момент.\n\n                             [color=#1d7a1d][head=3]Сведения о планете[/head][/color]\n\n  Планета носит кодовое наименование \"Колтер\" в связи с крайне суровым холодным климатом. Сама планета меньше Земли примерно в шесть раз. Не заселена ни одним из известных корпорации разумных видов существ. \n  Температура на улице редко поднимается выше -25 градусов, в связи с чем рекомендуется распределять один комплект зимней одежды на одну душу. \n  Атмосфера на планете более чем пригодна для дыхания. Однако, в связи с частыми \"извержениями\" газообразной плазмы в атмосферу - в скором времени ситуация может обостриться. Поспешу вас обрадовать - этого не произойдёт в ближайшие несколько месяцев.\n  Вы и ваш объект находитесь на объекте архипелага номер №1.1., а по другую сторону главного моста распологаются объекты №1.2., №1.3., №1.4., №1.5., №1.6., №1.7., №1.8. и №1.9. Неквалифицированному персоналу крайне не рекомендуется выходить за пределы комплекса во избежание несчастных случаев обморожения.\n  Планета наполнена плазмой во всех трёх её видах:\n1. На планете большое количество ущелий с газообразной плазмой. \n2. На планете присутствуют плазменные реки. Однако, они находятся на отдалённых от архипелага островах.\n3. На планете находится твёрдая плазма в огромных количествах. Её можно найти почти везде.\n  Секториальный штаб надеется, что объект оправдает все ожидания и сможет в должной мере защитить экипаж от непредвиденных переохлаждений.\n\n[italic][color=#b8972d]Слава NanoTrasen!\n[/italic][/color]\n=============================================\n                                [italic]Место для печатей[/italic]"
